        #region Methods
        /// <summary>
        /// Disables this <see cref="TouchIndicator"/>.
        /// </summary>
        /// <exception cref="ObjectDisposedException">
        /// This <see cref="TouchIndicator"/> has already been disposed of.
        /// </exception>
        public void Disable()
        {
            if (IsDisposed) { throw new ObjectDisposedException(GetType().FullName); }

            currentTouchPosition = null;
            GameHost.GameObjects.Remove(this);
            IsEnabled = false;
        }

        /// <summary>
        /// Enables this <see cref="TouchIndicator"/>.
        /// </summary>
        /// <exception cref="ObjectDisposedException">
        /// This <see cref="TouchIndicator"/> has already been disposed of.
        /// </exception>
        public void Enable()
        {
            if (IsDisposed) { throw new ObjectDisposedException(GetType().FullName); }

            GameHost.GameObjects.Add(this);
            IsEnabled = true;
        }

        /// <summary>
        /// Draws this <see cref="TouchIndicator"/>.
        /// </summary>
        /// <param name="gameTime">Time elapsed since the last call to <b>Draw</b>.</param>
        /// <param name="spriteBatch">The <b>SpriteBatch</b> that groups the sprites to be drawn.</param>
        /// <exception cref="ObjectDisposedException">
        /// This <see cref="TouchIndicator"/> has already been disposed of.
        /// </exception>
        public override void Draw(GameTime gameTime, SpriteBatch spriteBatch)
        {
            if (IsDisposed) { throw new ObjectDisposedException(GetType().FullName); }

            if (currentTouchPosition != null) {
                Color color = Color;
                color.A = (byte) fadeAlpha;
                spriteBatch.Draw(Texture, currentTouchPosition.Value, color);
            }
        }

        /// <summary>
        /// Updates this <see cref="TouchIndicator"/>.
        /// </summary>
        /// <param name="gameTime">Time elapsed since the last call to <b>Update</b>.</param>
        /// <exception cref="ObjectDisposedException">
        /// This <see cref="TouchIndicator"/> has already been disposed of.
        /// </exception>
        public override void Update(GameTime gameTime)
        {
            if (IsDisposed) { throw new ObjectDisposedException(GetType().FullName); }

            TouchCollection touchLocationState = TouchPanel.GetState();

            if (touchLocationState.Count > 0) {
                currentTouchPosition = Position = touchLocationState[0].Position + AdjustToTouchOffset;

                if (fadeAlpha != MaxFadeAlpha) {
                    fadeAlpha = MaxFadeAlpha;
                }
            } else {
                fadeAlpha -= 10;

                if (fadeAlpha <= 0) {
                    fadeAlpha = MaxFadeAlpha;
                    currentTouchPosition = null;
                }
            }
        }
